import React from "react";
import { TopBar } from "@shopify/polaris";

function topBarMarkup() {
  return (
    <TopBar
      showNavigationToggle
      serMenu
      name="Ritu"
      detail="Shopify, Inc."
      initials="RS"
    />
  );
}

export default topBarMarkup();
